import React from 'react';
import { Link } from 'react-router-dom';


import Headers from '../../../../header'
import '../../../../../css/pages/categories/vnedorojnik/toyota_lc_200/toyotaLc200.scss'

function ToyotaLc200() {
  return (
    <>
        <Headers/>
        <div className="toyotaLc200">
            <div className="container">
                <div className="title">
                    <div className='text'><Link to='/categories'>Категории </Link>/ <Link to='/vnedorojnik'>Внедорожник</Link> /</div>
                </div>
            </div>
        </div>
    </>
  )
}

export default ToyotaLc200;
